import PetPhotoUpload from "./PetPhotoUpload";

// Pet Listesi
{pets.map((pet) => (
  <li key={pet._id} className="list-group-item">
    <div>
      {pet.photoUrl && (
        <img
          src={pet.photoUrl}
          alt={pet.name}
          style={{ width: "50px", height: "50px", borderRadius: "50%", marginRight: "10px" }}
        />
      )}
      <strong>{pet.name}</strong> - {pet.species}
    </div>
    <PetPhotoUpload petId={pet._id} setPets={setPets} />
  </li>
))}
